import React from "react";
import { FaInstagram,FaFacebook,FaTwitter } from "react-icons/fa";

const Footer = () => {
  return (
    <footer style={styles.footer}>
      <p>&copy; 2024 Fresh SuperMarket. All rights reserved.</p>
    </footer>
  );
};

const styles = {
  footer: { textAlign: "center",height:"109px" ,padding: "29px", backgroundColor:"rgb(226, 49, 49)", position: "relative" ,top:"645px",fontWeight:"bold",fontSize:"16px"},
};

export default Footer;
